export default function About() {
  return (
    <div className="text-center mt-10">
      <h2 className="text-2xl font-bold">À propos de My Weather App</h2>
      <p className="mt-4 max-w-md mx-auto">
        Cette application affiche la météo actuelle d'une ville en utilisant
        l'API OpenWeatherMap. Réalisée avec ❤️ en React et Tailwind CSS.
      </p>
    </div>
  );
}
